import Link from 'next/link';

const Header = (props) => (
    <div>
        <Link href="/">
            <a>Home</a>
        </Link>
        <Link href='/pokimon'>
            <a>Pokemones</a>
        </Link>
        {props.children}
    </div>
)

export default Header;
